// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awTabContainerRenderFn } from 'js/AwTabContainerService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwTabContainerService', () => import('js/AwTabContainerService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awTabContainerRenderFn",
            "deps": "js/AwTabContainerService",
            "options": {
                "elementRefList": [
                    "tabset"
                ]
            }
        },
        "tabSetOverflowPopup": {
            "actionType": "popup",
            "options": {
                "placement": "bottom-start",
                "toggleMode": true,
                "whenParentScrolls": "close",
                "clickOutsideToClose": true,
                "resizeToClose": true
            }
        },
        "unRegisterTabSet": {
            "actionType": "JSFunction",
            "method": "unRegisterTabSet",
            "inputData": {
                "tabSetId": "{{data.tabSetId}}"
            },
            "deps": "js/AwTabContainerService"
        },
        "onMount": {
            "actionType": "JSFunction",
            "method": "onMount",
            "inputData": {
                "elementRefList": "{{parameters.elementRefList}}",
                "props": "{{props}}",
                "data": "{{data}}"
            },
            "deps": "js/AwTabContainerService"
        },
        "onSelectionDataChange": {
            "actionType": "JSFunction",
            "method": "onSelectionDataChange",
            "inputData": {
                "subPanelContext": "{{props.subPanelContext}}",
                "data": "{{data}}"
            },
            "deps": "js/AwTabContainerService"
        }
    },
    "data": {
        "overflowConfig": {
            "overflownTabs": [],
            "hideMore": true,
            "currentTabIndex": "",
            "replacedTabIndex": ""
        },
        "tabsModel": [],
        "currentSelectedTabId": "",
        "manualTabSelection": false,
        "previousSelectedTabId": ""
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "onMount",
        "onUnmount": "unRegisterTabSet",
        "onUpdate": {
            "action": "onSelectionDataChange",
            "observers": [
                "props.subPanelContext.pselected",
                "props.subPanelContext.selected"
            ]
        }
    },
    "props": {
        "tab-container-model": {
            "type": "object"
        },
        "callback": {
            "type": "object"
        },
        "tab-set-id": {
            "type": "string"
        },
        "sub-panel-context": {
            "type": "object"
        },
        "on-tab-close": {
            "type": "object"
        }
    },
    "_viewModelId": "AwTabContainer",
    "_uniqueViewModelId": "AwTabContainer",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awTabContainerRenderFn, {"elementRefList":["tabset"]}, ctxImportObj );

export default Component;
